gOy(){return"The manuscript is written in a formal uncial script (biblical majuscule) in Greek, featuring scriptio continua (continuous script without spaces between words). The text is arranged in columns: four columns per page in the New Testament and two per page for poetic texts. It also includes carefully regulated line breaks, nomina sacra, and distinctive punctuation."},
gOw(){return"Codex Sinaiticus was discovered in 1844 at Saint Catherine\u2019s Monastery on the Sinai Peninsula by Constantin von Tischendorf."},
