gON(){return"The Codex Ephraemi Rescriptus is a palimpsest manuscript of the Greek Bible, written on parchment. It consists of 209 leaves, measuring approximately 33 x 27 cm, with 145 leaves belonging to the New Testament and 64 to the Old Testament."},
