gN2(){return"\u0412 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0435 \u0432\u0440\u0435\u043c\u044f \u041f\u0430\u043f\u0438\u0440\u0443\u0441 24 \u0445\u0440\u0430\u043d\u0438\u0442\u0441\u044f \u0432 \u0431\u0438\u0431\u043b\u0438\u043e\u0442\u0435\u043a\u0435 \u0419\u0435\u043b\u044c\u0441\u043a\u043e\u0439 \u0448\u043a\u043e\u043b\u044b \u0431\u043e\u0433\u043e\u0441\u043b\u043e\u0432\u0438\u044f \u0432 \u041d\u044c\u044e-\u0425\u0435\u0439\u0432\u0435\u043d\u0435, \u0448\u0442\u0430\u0442 \u041a\u043e\u043d\u043d\u0435\u043a\u0442\u0438\u043a\u0443\u0442, \u043a\u0430\u043a \u0447\u0430\u0441\u0442\u044c \u043a\u043e\u043b\u043b\u0435\u043a\u0446\u0438\u0438 \u041e\u043a\u0441\u0438\u0440\u0438\u043d\u0445\u0441\u043a\u0438\u0445 \u043f\u0430\u043f\u0438\u0440\u0443\u0441\u043e\u0432 \u0410\u043d\u0434\u043e\u0432\u0435\u0440 \u041d\u044c\u044e\u0442\u043e\u043d\u0430."},
