gNl(){return"\u041f\u0435\u0440\u0432\u043e\u0438\u0441\u0442\u043e\u0447\u043d\u0438\u043a \u043d\u0430\u043f\u0438\u0441\u0430\u043d \u043d\u0430 \u043f\u0430\u043f\u0438\u0440\u0443\u0441\u0435, \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u0435, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u043d\u043e\u043c \u0434\u043b\u044f \u0440\u0430\u043d\u043d\u0438\u0445 \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u0435\u0439. \u041e\u043d \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u0438\u0437 10 \u043b\u0438\u0441\u0442\u043e\u0432, \u0440\u0430\u0437\u043c\u0435\u0440\u043e\u043c \u043f\u0440\u0438\u043c\u0435\u0440\u043e\u043d\u043e 24 \xd7 13 \u0441\u043c. \u0420\u0443\u043a\u043e\u043f\u0438\u0441\u044c \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0434\u043d\u0438\u043c \u0438\u0437 \u0434\u0440\u0435\u0432\u043d\u0435\u0439\u0448\u0438\u0445 \u0441\u043e\u0445\u0440\u0430\u043d\u0438\u0432\u0448\u0438\u0445\u0441\u044f \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442\u043e\u0432 \u041d\u043e\u0432\u043e\u0433\u043e \u0417\u0430\u0432\u0435\u0442\u0430."},
gNm(){return"\u0422\u0435\u043a\u0441\u0442 \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d \u043f\u043b\u043e\u0442\u043d\u044b\u043c \u0433\u0440\u0435\u0447\u0435\u0441\u043a\u0438\u043c \u0443\u043d\u0446\u0438\u0430\u043b\u043e\u043c \u0447\u0451\u0440\u043d\u044b\u043c\u0438 \u0447\u0435\u0440\u043d\u0438\u043b\u0430\u043c\u0438, \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d \u0432 \u043e\u0434\u043d\u0443 \u043a\u043e\u043b\u043e\u043d\u043a\u0443 \u043d\u0430 \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0435 \u0441 \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u0438\u0442\u0435\u043b\u044c\u043d\u043e 25-30 \u0441\u0442\u0440\u043e\u043a\u0430\u043c\u0438 \u043d\u0430 \u043b\u0438\u0441\u0442\u0435. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0441\u043f\u043b\u043e\u0448\u043d\u043e\u0435 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0435 (scriptio continua) \u0431\u0435\u0437 \u0440\u0430\u0437\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u0441\u043b\u043e\u0432."},
