gON(){return"\u041a\u043e\u0434\u0435\u043a\u0441 \u0404\u0444\u0440\u0435\u043c\u0430 - \u0446\u0435 \u043f\u0430\u043b\u0456\u043c\u043f\u0441\u0435\u0441\u0442 \u0433\u0440\u0435\u0446\u044c\u043a\u043e\u0457 \u0411\u0456\u0431\u043b\u0456\u0457, \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0456. \u0412\u0456\u043d \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 209 \u0430\u0440\u043a\u0443\u0448\u0456\u0432 \u0440\u043e\u0437\u043c\u0456\u0440\u043e\u043c \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e 33 x 27 \u0441\u043c, \u0437 \u044f\u043a\u0438\u0445 145 \u0430\u0440\u043a\u0443\u0448\u0456\u0432 \u043d\u0430\u043b\u0435\u0436\u0430\u0442\u044c \u0434\u043e \u041d\u043e\u0432\u043e\u0433\u043e \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0443 \u0456 64 \u0434\u043e \u0421\u0442\u0430\u0440\u043e\u0433\u043e \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0443."},
gOO(){return"\u0422\u0435\u043a\u0441\u0442 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u0441\u0435\u0440\u0435\u0434\u043d\u0456\u043c \u0437\u0430 \u0440\u043e\u0437\u043c\u0456\u0440\u043e\u043c \u0443\u043d\u0446\u0456\u0430\u043b\u044c\u043d\u0438\u043c \u043f\u0438\u0441\u044c\u043c\u043e\u043c \u0433\u0440\u0435\u0446\u044c\u043a\u043e\u044e \u043c\u043e\u0432\u043e\u044e, \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u043c \u0432 \u043e\u0434\u043d\u0443 \u043a\u043e\u043b\u043e\u043d\u043a\u0443 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u0437 40-46 \u0440\u044f\u0434\u043a\u0430\u043c\u0438 \u0443 \u043a\u043e\u043b\u043e\u043d\u0446\u0456. \u041a\u043e\u0434\u0435\u043a\u0441 \u0441\u043b\u0456\u0434\u0443\u0454 \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u0443 scriptio continua \u0431\u0435\u0437 \u0440\u043e\u0437\u0434\u0456\u043b\u0435\u043d\u043d\u044f \u0441\u043b\u0456\u0432, \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0447\u0438 \u043b\u0438\u0448\u0435 \u043e\u0434\u043d\u0443 \u043a\u0440\u0430\u043f\u043a\u0443 \u0434\u043b\u044f \u043f\u0443\u043d\u043a\u0442\u0443\u0430\u0446\u0456\u0457, \u0442\u0430 \u043c\u0430\u0454 \u0437\u0431\u0456\u043b\u044c\u0448\u0435\u043d\u0456 \u043b\u0456\u0442\u0435\u0440\u0438 \u043d\u0430 \u043f\u043e\u0447\u0430\u0442\u043a\u0443 \u0440\u043e\u0437\u0434\u0456\u043b\u0456\u0432, \u0449\u043e \u0432\u0438\u0441\u0442\u0443\u043f\u0430\u044e\u0442\u044c \u043d\u0430 \u043f\u043e\u043b\u044f. \u0420\u0443\u043a\u043e\u043f\u0438\u0441 \u043c\u0456\u0441\u0442\u0438\u0442\u044c nomina sacra, \u0441\u043a\u043e\u0440\u043e\u0447\u0435\u043d\u0456 \u0434\u043e \u0442\u0440\u0438\u043b\u0456\u0442\u0435\u0440\u043d\u0438\u0445 \u0444\u043e\u0440\u043c."},
gOM(){return"\u0420\u0443\u043a\u043e\u043f\u0438\u0441 \u0431\u0443\u0432 \u043f\u0440\u0438\u0432\u0435\u0437\u0435\u043d\u0438\u0439 \u0434\u043e \u0424\u043b\u043e\u0440\u0435\u043d\u0446\u0456\u0457 \u0432\u0447\u0435\u043d\u0438\u043c-\u0435\u043c\u0456\u0433\u0440\u0430\u043d\u0442\u043e\u043c \u043f\u0456\u0441\u043b\u044f \u043f\u0430\u0434\u0456\u043d\u043d\u044f \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044f \u0432 1453 \u0440\u043e\u0446\u0456, \u0430 \u043f\u043e\u0442\u0456\u043c \u043f\u0435\u0440\u0435\u0432\u0435\u0437\u0435\u043d\u0438\u0439 \u0434\u043e \u0424\u0440\u0430\u043d\u0446\u0456\u0457 \u0443 XVI \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u0456 \u041a\u0430\u0442\u0435\u0440\u0438\u043d\u043e\u044e \u041c\u0435\u0434\u0456\u0447\u0456. \u041d\u0430\u0439\u0434\u0430\u0432\u043d\u0456\u0448\u0438\u0439 \u0431\u0456\u0431\u043b\u0456\u0439\u043d\u0438\u0439 \u0442\u0435\u043a\u0441\u0442 \u0431\u0443\u0432 \u0432\u043f\u0435\u0440\u0448\u0435 \u043f\u043e\u043c\u0456\u0447\u0435\u043d\u0438\u0439 \u041f'\u0454\u0440\u043e\u043c \u0410\u043b\u043b\u0456\u043a\u0441\u043e\u043c, \u043f\u0440\u043e\u0442\u0435\u0441\u0442\u0430\u043d\u0442\u0441\u044c\u043a\u0438\u043c \u043f\u0430\u0441\u0442\u043e\u0440\u043e\u043c, \u043d\u0430 \u043f\u043e\u0447\u0430\u0442\u043a\u0443 XVIII \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f. \u0420\u0456\u0437\u043d\u0456 \u0434\u043e\u0441\u043b\u0456\u0434\u043d\u0438\u043a\u0438 \u0447\u0430\u0441 \u0432\u0456\u0434 \u0447\u0430\u0441\u0443 \u0440\u043e\u0431\u0438\u043b\u0438 \u0432\u0438\u0442\u044f\u0433\u0438 \u0437 \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u0443, \u0430\u043b\u0435 \u0422\u0456\u0448\u0435\u043d\u0434\u043e\u0440\u0444 \u0431\u0443\u0432 \u043f\u0435\u0440\u0448\u0438\u043c, \u0445\u0442\u043e \u043f\u0440\u043e\u0447\u0438\u0442\u0430\u0432 \u0439\u043e\u0433\u043e \u043f\u043e\u0432\u043d\u0456\u0441\u0442\u044e \u0432 1845 \u0440\u043e\u0446\u0456."},
gOI(){return"\u0417 \u0442\u0435\u043a\u0441\u0442\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u043e\u0457 \u043f\u0435\u0440\u0441\u043f\u0435\u043a\u0442\u0438\u0432\u0438, \u043a\u043e\u0434\u0435\u043a\u0441 \u043f\u0435\u0440\u0435\u0432\u0430\u0436\u043d\u043e \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0454 \u0430\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u0438\u0439 \u0442\u0438\u043f \u0442\u0435\u043a\u0441\u0442\u0443, \u0445\u043e\u0447\u0430 \u0439\u043e\u0433\u043e \u043f\u0440\u0438\u043d\u0430\u043b\u0435\u0436\u043d\u0456\u0441\u0442\u044c \u0432\u0430\u0440\u0456\u044e\u0454\u0442\u044c\u0441\u044f \u0432 \u0440\u0456\u0437\u043d\u0438\u0445 \u043a\u043d\u0438\u0433\u0430\u0445 \u041d\u043e\u0432\u043e\u0433\u043e \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0443. \u041a\u0443\u0440\u0442 \u0410\u043b\u0430\u043d\u0434 \u043a\u043b\u0430\u0441\u0438\u0444\u0456\u043a\u0443\u0432\u0430\u0432 \u0439\u043e\u0433\u043e \u044f\u043a \u0440\u0443\u043a\u043e\u043f\u0438\u0441 \u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0456\u0457 II \u0443 \u0441\u0432\u043e\u0457\u0439 \u0441\u0438\u0441\u0442\u0435\u043c\u0456 \u043a\u043b\u0430\u0441\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u0457 \u0442\u0435\u043a\u0441\u0442\u0456\u0432 \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u0456\u0432 \u041d\u043e\u0432\u043e\u0433\u043e \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0443."},
