gPs(){return"\u041f\u043e\u0440\u0444\u0438\u0440\u0456\u0430\u043d\u0441\u044c\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 (P<sup>apr</sup> 025)"},
gPo(){return"IX \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f \u043d.\u0435."},
